import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class EmpformserviceService {

  constructor(private http:HttpClient) { }


  submitapi(data:any){
    return this.http.post("http://localhost:3000/signupEmp",data);
  }


}
